import React, {setState} from "react";

class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = {clicked:false};
  }
  render() {
    const {clicked} = this.state;
    if(clicked) {
      return "clicked";
    }
    return (
      <div>
        <button onClick={()=>{this.setState({clicked : true})}}>ClickMe</button>
      </div>
    )
  }

}

function App() {
  return (
    <>
    <h1>hello world</h1>
    <Button />
    </>
  );
}

export default App;
